import React from 'react';

const SkillsSection = () => {
  return (
    <div className="skills-container container flex py-20 justify-center items-center gap-20">
      <div className="skill-container-left">
        <h2 className="skill-heading text-4xl text-orange-500">Skills</h2>
        <p className="skill-subHeading text-lg mt-6">I am proficient in these technologies.</p>
      </div>
      <div className="skill-container-right flex flex-wrap gap-6 justify-center">
        <img src="/images/skills/javascript.png" alt="JavaScript" className="skills-logo w-20" />
        <img src="/images/skills/react.png" alt="React" className="skills-logo w-20" />
        <img src="/images/skills/nodejs.png" alt="Node.js" className="skills-logo w-20" />
      </div>
    </div>
  );
};

export default SkillsSection;
